import React from 'react';
import { Nav } from 'react-bootstrap';

function Sidebar({ show, handleSelectCarousel }) {
    return (
        <div className={`sidebar ${show ? 'active' : ''}`}>
            <Nav className="flex-column">
                <Nav.Link onClick={() => handleSelectCarousel(1)}>Carrusel 1</Nav.Link>
                <Nav.Link onClick={() => handleSelectCarousel(2)}>Carrusel 2</Nav.Link>
            </Nav>
        </div>
    );
}

export default Sidebar;
